import React, { Component } from 'react';
import { Breadcrumb, BreadcrumbItem, Button, Form, FormGroup, Label, Input, Col } from 'reactstrap';
import { Link } from 'react-router-dom';

class Contact extends Component{
      constructor(props){
          super(props);
          this.state = {
              firstName: '',
              lastName: '',
              phoneNum: '',
              email: '',
              agree: false,
              contactType: 'By Phone',
              feedback:''
          };
          this.handleInputChange = this.handleInputChange.bind(this);
          this.handleSubmit = this.handleSubmit.bind(this);
      } 

      handleInputChange(event){
          const target = event.target;
          const name = target.name;
          const value = target.type === 'checkbox' ? target.checked : target.value;

          this.setState({
              [name] : value
          });
      }

      handleSubmit(event){
          console.log("Current state is : " + JSON.stringify(this.state));
          alert("Current state is : " + JSON.stringify(this.state));
          event.preventDefault();
      }

      render(){
        return (
            <div className="container">
                <div className="row">
                    <div className="col">
                       <Breadcrumb>
                            <BreadcrumbItem><Link to="/home">Home</Link></BreadcrumbItem>
                            <BreadcrumbItem active>Contact Us</BreadcrumbItem>
                        </Breadcrumb>
                        <h2>Contact Us</h2>
                        <hr />
                    </div>
                </div>

                <div className="row row-content align-items-center">
                    <div className="col-sm-4">
                        <h5>Our Address</h5>
                        <address>
                            1  Way<br />
                            Absecon, NJ 08201<br />
                            U.S.A.
                        </address>
                    </div>
                    <div className="col">
                        <a role="button" className="btn btn-link" href="tel:+12065551234"><i className="fa fa-phone" /> 1-718-674-4990</a><br />
                        <a role="button" className="btn btn-link" href="mailto:fakeemail@fakeemail.co"><i className="fa fa-envelope-o" /> salmoonsamuel08@gmail.com</a>
                    </div>
                </div>
                <div className="row">
                     <div className="col-12">
                         <h2>Send us your Feedback</h2>
                         <hr />
                     </div>
                     <div className="">
                         <Form></Form>
                     </div>
                </div>
            </div>

        );
      }

}

export default Contact;
